  "HORTENSIO: Tush, Gremio, though it pass your patience and mine to endure her loud alarums, why, man, there be good fellows in the world, an a man could light on them, would take her with all faults, and money enough.  GREMIO: I cannot tell; but I had as lief take her dowry with this condition, to be whipped at the high cross every morning.",
  "You take my lord, I'll give him my commission To let him there a month behind the gest Prefix'd for's parting: yet, good deed, Leontes, I love thee not a jar o' the clock behind What lady-she her lord. You'll stay?  POLIXENES: No, madam.  HERMIONE:",
  "I shall, sir.  MENENIUS: The augurer tells me we shall have news to-night.  BRUTUS: Good or bad?  MENENIUS: Not according to the prayer of the people, for they",
  "Immediately we do exile him hence: I have an interest in your hate's proceeding, My blood for your rude brawls doth lie a-bleeding; But I'll amerce you with so strong a fine That you shall all repent the loss of mine: I will be deaf to pleading and excuses; Nor tears nor prayers shall purchase out abuses: Therefore use none: let Romeo hence in haste, Else, when he's found, that hour is his last. Bear hence this body and attend our will:",
  "KING HENRY VI: I was anointed king at nine months old; My father and my grandfather were kings, And you were sworn true subjects unto me: And tell me, then, have you not broke your oaths?  First Keeper: No; For we were subjects but while you were king. ",
  "And therefore I'll uncrown him ere't be long.'  KING EDWARD IV: Ha! durst the traitor breathe out so proud words? Well I will arm me, being thus forewarn'd: They shall have wars and pay for their presumption. But say, is Warwick friends with Margaret?  Post: Ay, gracious sovereign; they are so link'd in",
  "GREGORY: The heads of the maids?  SAMPSON: Ay, the heads of the maids, or their maidenheads; take it in what sense thou wilt.  GREGORY: They must take it in sense that feel it. ",
  "My Lord of Westminster, be it your charge To keep him safely till his day of trial. May it please you, lords, to grant the commons' suit.  HENRY BOLINGBROKE: Fetch hither Richard, that in common view He may surrender; so we shall proceed Without suspicion.  DUKE OF YORK:",
  "And cheer his grace with quick and merry words.  QUEEN ELIZABETH: If he were dead, what would betide of me?  RIVERS: No other harm but loss of such a lord.  QUEEN ELIZABETH: The loss of such a lord includes all harm.",
  "Do not draw the curtain.  PAULINA: No longer shall you gaze on't, lest your fancy May think anon it moves.  LEONTES: Let be, let be. Would I were dead, but that, methinks, already-- What was he that did make it? See, my lord,",
  "He dies for Claudio's death.  ISABELLA: Most bounteous sir, Look, if it please you, on this man condemn'd, As if my brother lived: I partly think A due sincerity govern'd his deeds, Till he did look on me: since it is so, Let him not die. My brother had but justice, In that he did the thing for which he died:",
  "I for a Clarence weep, so doth not she: These babes for Clarence weep and so do I; I for an Edward weep, so do not they: Alas, you three, on me, threefold distress'd, Pour all your tears! I am your sorrow's nurse, And I will pamper it with lamentations.  DORSET: Comfort, dear mother: God is much displeased That you take with unthankfulness, his doing:",
  "Money's a medler. That doth utter all men's ware-a.  Servant: Master, there is three carters, three shepherds, three neat-herds, three swine-herds, that have made themselves all men of hair, they call themselves Saltiers, and they have a dance which the wenches say is a gallimaufry of gambols, because they are not in't; but they themselves are o' the mind, if it",
  "What is the city but the people?  Citizens: True, The people are the city.  BRUTUS: By the consent of all, we were establish'd The people's magistrates. ",
  "'Tis very late, she'll not come down to-night: I promise you, but for your company, I would have been a-bed an hour ago.  PARIS: These times of woe afford no time to woo. Madam, good night: commend me to your daughter.  LADY CAPULET: I will, and know her mind early to-morrow;",
  "It is a mind That shall remain a poison where it is, Not poison any further.  CORIOLANUS: Shall remain! Hear you this Triton of the minnows? mark you His absolute 'shall'?  COMINIUS:",
  " QUEEN: How fares our noble uncle, Lancaster?  KING RICHARD II: What comfort, man? how is't with aged Gaunt?  JOHN OF GAUNT: O how that name befits my composition! Old Gaunt indeed, and gaunt in being old:",
  "Hath power enough to serve our turn. But who comes here?  SIR STEPHEN SCROOP: More health and happiness betide my liege Than can my care-tuned tongue deliver him!  KING RICHARD II: Mine ear is open and my heart prepared; The worst is worldly loss thou canst unfold. Say, is my kingdom lost? why, 'twas my care",
  "To speak with you; may it please you to come down.  KING RICHARD II: Down, down I come; like glistering Phaethon, Wanting the manage of unruly jades. In the base court? Base court, where kings grow base, To come at traitors' calls and do them grace. In the base court? Come down? Down, court! down, king! For night-owls shriek where mounting larks",
  "GLOUCESTER: Fairer than tongue can name thee, let me have Some patient leisure to excuse myself.  LADY ANNE: Fouler than heart can think thee, thou canst make No excuse current, but to hang thyself.  GLOUCESTER: By such despair, I should accuse myself.",
  "Didst thou not mark the king, what words he spake, 'Have I no friend will rid me of this living fear?' Was it not so?  Servant: These were his very words.  EXTON: 'Have I no friend?' quoth he: he spake it twice, And urged it twice together, did he not?",
  "For, knowing thee to be but young and light--  KATHARINA: Too light for such a swain as you to catch; And yet as heavy as my weight should be.  PETRUCHIO: Should be! should--buzz!  KATHARINA:",
  " VOLUMNIA: If it be honour in your wars to seem The same you are not, which, for your best ends, You adopt your policy, how is it less or worse, That it shall hold companionship in peace With honour, as in war, since that to both It stands in like request?  CORIOLANUS:",
  "And tell 's a tale.  MAMILLIUS: Merry or sad shall't be?  HERMIONE: As merry as you will.  MAMILLIUS: A sad tale's best for winter: I have one",
