  " OXFORD: And thus I seal my truth, and bid adieu.  KING HENRY VI: Sweet Oxford, and my loving Montague, And all at once, once more a happy farewell.  WARWICK: Farewell, sweet lords: let's meet at Coventry.",
  "And loves not me, be you, good lord, assured I hate not you for her proud arrogance.  DERBY: I do beseech you, either not believe The envious slanders of her false accusers; Or, if she be accused in true report, Bear with her weakness, which, I think proceeds From wayward sickness, and no grounded malice. ",
