  " CAPULET: Why, I am glad on't; this is well: stand up: This is as't should be. Let me see the county; Ay, marry, go, I say, and fetch him hither. Now, afore God! this reverend holy friar, Our whole city is much bound to him.  JULIET: Nurse, will you go with me into my closet,",
